import React, { useEffect } from 'react';
import { Header } from './Header.js';
import { Main } from './Main.js';
import { Footer } from './Footer.js';
import { PopupWithForm } from './PopupWithForm.js';
import { ImagePopup } from './ImagePopup.js';

function App() {
    const [isEditProfilePopupOpen, setIsEditProfilePopupOpen] = React.useState(false);
    const [isAddPlacePopupOpen, setIsAddPlacePopupOpen] = React.useState(false);
    const [isEditAvatarPopupOpen, setIsEditAvatarPopupOpen] = React.useState(false);

    function closeAllPopup() {
        setIsEditAvatarPopupOpen(true);
        setIsEditProfilePopupOpen(false);
        setIsAddPlacePopupOpen(false);
    }

    function handleEditAvatarClick() {
        setIsEditAvatarPopupOpen(true);
    }

    function handleEditProfileClick() {
        setIsEditProfilePopupOpen(true);
    }

    function handleAddPlaceClick() {
        setIsAddPlacePopupOpen(true);
    }
    return (
        <div className="page">
            <Header />
            <Main onEditAvatar={handleEditAvatarClick} onEditProfile={handleEditProfileClick} onAddPlace={handleAddPlaceClick}/>
            <Footer />
            <PopupWithForm name='edit' title='Редактировать профиль' isOpen={isEditProfilePopupOpen}>
                <input className="form__input form__input_data_name" type="text" placeholder="Имя" name="name" id="name" required minLength="2" maxLength="40" />
                <span className="form__error name-error"></span>
                <input className="form__input form__input_data_profession" type="text" placeholder="О себе"
                    name="profession" id="profession" required minLength="2" maxLength="200" />
                <span className="form__error profession-error"></span>
            </PopupWithForm>

            <PopupWithForm name='add' title='Новое место' isOpen={isAddPlacePopupOpen}>
                <input className="form__input form__input_element_name" type="text" placeholder="Название"
                    name="name" id="element-name" required minLength="2" maxLength="30" />
                <span className="form__error element-name-error"></span>
                <input className="form__input form__input_element_link" type="url" placeholder="Ссылка на картинку"
                    name="link" id="element-link" required />
                <span className="form__error element-link-error"></span>
            </PopupWithForm>
            <PopupWithForm name='delete' title='Вы уверены?' />
            <PopupWithForm name='avatar' title='Обновить аватар' isOpen={isEditAvatarPopupOpen}>
                <input className="form__input form__input_avatar_link" type="url" placeholder="Ссылка на новый аватар"
                    name="avatar" id="avatar" required />
                <span className="form__error avatar-error"></span>
            </PopupWithForm>
            <ImagePopup />

            <template id="elements-items-template">
                <li className="elements__item">
                    <img className="elements__image" src="#" />
                    <div className="elements__group">
                        <h2 className="elements__title"></h2>
                        <div className="elements__like-container">
                            <button className="elements__like-button" type="button" aria-label="Лайкнуть фото"></button>
                            <span className="elements__like-counter">0</span>
                        </div>
                    </div>
                    <button className="elements__delete-button" aria-label="удалить фотографию"></button>
                </li>
            </template>
        </div>
    );
}

export default App;
